import React, { Component } from 'react';
import { post, isAuthenciate } from '../auth/index';
import { Redirect } from 'react-router-dom';

class Post extends Component {

    constructor() {
        super();
        this.state = {
            title: "",
            body: "",
            error: "",
            redirecttopage: false
        }
    }

    componentDidMount() {
        this.userData = new FormData();
    }

    handleChange = title => event => {
        const value = title === 'photo' ? event.target.files[0] : event.target.value;
        this.userData.set(title, value);
        this.setState({error: ""});
        this.setState({[title]: value});
    }

    clickSubmit = event => {
        event.preventDefault();
        const userId = isAuthenciate().user._id;
        const tokens = isAuthenciate().token;
        post(this.userData, userId, tokens).then(data => {
            if(data.error) {
                this.setState({ error: "" });
            }else {
                this.setState({ redirecttopage: true });
            }
        })
    }

    postForm = (title, body) => (
        <form>
            <div className="form-group">
                <label className="text-muted">Photo</label>
                <input accept="image/*" type="file" onChange={this.handleChange("photo")} className="form-control" />
            </div>
            <div className="form-group">
                <label className="text-muted">Title</label>
                <input type="text" onChange={this.handleChange("title")} className="form-control" value={title}/>
            </div>
            <div className="form-group">
                <label className="text-muted">Body</label>
                <input type="email" onChange={this.handleChange("body")} className="form-control" value={body}/>
            </div>
            <div className="form-group">
                <button onClick={this.clickSubmit} className="btn btn-raised btn-primary">Submit</button>
            </div>
        </form>
    );

    render() {
        const { title, body,redirecttopage } = this.state;

        if(redirecttopage) {
            return <Redirect to="/" />
        }

        return (
            <div>
                <div  className="jumbotron">
                    <h1>Post</h1>
                </div>
                <div className="container">
                    {this.postForm(title, body)}
                </div>
            </div>
        );
    }
}

export default Post;

<div className="col-sm-9 col-md-6 col-lg-8">
{
    post.map((post, i) => (
        <div className="card promoting-card" key={i}>
          <div className="card-body d-flex flex-row">
            <img src="https://mdbootstrap.com/img/Photos/Avatars/avatar-8.jpg" class="rounded-circle mr-3" height="50px" width="50px" alt="avatar" />
            <div>
              <h4 className="card-title font-weight-bold mb-2">{post.postedBy.name ? post.postedBy.name : 'Name'}</h4>
              <p className="card-text"><i class="far fa-clock pr-2"></i>07/24/2018</p>
            </div>
          </div>

          <div className="view overlay">
            <img className="card-img-top rounded-0" src="https://mdbootstrap.com/img/Photos/Horizontal/Food/full page/2.jpg" alt="Card image cap" />
            <a href="#!">
              <div className="mask rgba-white-slight"></div>
            </a>
          </div>
          <div className="card-body">
            <div className="collapse-content">
              <p className="card-text collapse" id="collapseContent">Recently, we added several exotic new dishes to our restaurant menu. They come from countries such as Mexico, Argentina, and Spain. Come to us, have some delicious wine and enjoy our juicy meals from around the world.</p>
              <a className="btn btn-flat red-text p-1 my-1 mr-0 mml-1 collapsed" data-toggle="collapse" href="#collapseContent" aria-expanded="false" aria-controls="collapseContent"></a>
              <i className="fa fa-share-alt text-muted float-right p-1 my-1" data-toggle="tooltip" data-placement="top" title="Share this post"></i>
              <i className="fa fa-heart text-muted float-right p-1 my-1 mr-3" data-toggle="tooltip" data-placement="top" title="I like it"></i>
            </div>
          </div>
        </div>
    ))}
</div>
